<p><ref target="https://ug.wikipedia.org/wiki/كىئۇفۇيۇتى_تەڭرىقۇت">كىئۇفۇيۇتى تەڭرىقۇت</ref>نىڭ ئوغلى ، مىلادىيە 63-يىلى تەختتە ئولتۇرغان ، ئۇ تارختا &lt;سۇ &gt; دىگەن نام بىلەنمۇ ئاتالغان ، تەختكە چىقىپ بىر نەچچە ئايدىن كېيىن ۋاپات بولغان .</p></text></body></html>
